import s from './Operators.module.css'
import Item from '../../Item';
const Operators = () => {
    return (
        <div className={s.item__wrapper}>
            Выбирите вашего оператора
            <Item content='МТС' />
            <Item content='Мегафон' />
            <Item content='Билайн' />
        </div>
            );
        }
export default Operators;
